"gl3" : "Guide on Chrome debugging:

1. Connect mobile to PC via data line；
2. Enable developer mode on android mobile that needs to be debugged and open USB debugging;
3.Open Chrome browser on PC and enter chrome://inspect;
4. Find the Widget page that needs to be debugged and click "inspect"."

